import React, { useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import "./RestaurantResults.css";

const RestaurantResults = () => {
    const [restaurants, setRestaurants] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [markers, setMarkers] = useState([]);
    const location = useLocation();
    const navigate = useNavigate();
    const { searchLocation } = location.state || {};


    useEffect(() => {
        const currentMarkers = markers; // Capture current markers for cleanup
        return () => {
            currentMarkers.forEach(marker => marker.setMap(null));
        };
    }, []);

    useEffect(() => {
        if (!searchLocation) {
            navigate("/");
            return;
        }
        const maxRetries = 5;
        const retryInterval = 1000; // 1 second

        const checkAndLoadMap = () => {
            let retryCount = 0;

            const load = () => {
                if (!window.google || !window.google.maps || !window.google.maps.places) {
                    if (retryCount < maxRetries) {
                        retryCount++;
                        setTimeout(load, retryInterval);
                        return;
                    }
                    setError("Failed to load Google Maps API. Please refresh the page.");
                    setLoading(false);
                    return;
                }

                loadMapAndSearchRestaurants();
            };

            load();
        };

        const loadMapAndSearchRestaurants = async () => {
            try {
                markers.forEach(marker => marker.setMap(null));
            setMarkers([]);

                if (!searchLocation?.coordinates?.lat || !searchLocation?.coordinates?.lng) {
                    setError("Invalid location coordinates");
                    setLoading(false);
                    return;
                }

                const coordinates = new window.google.maps.LatLng(
                    searchLocation.coordinates.lat,
                    searchLocation.coordinates.lng
                );

                const mapInstance = new window.google.maps.Map(document.getElementById("map"), {
                    center: coordinates,
                    zoom: 14,
                    mapId: "3d323ae4d3f413fd"
                });

                const service = new window.google.maps.places.PlacesService(mapInstance);

                const request = {
                    location: coordinates,
                    radius: 5000,
                    type: ["restaurant"],
                    rankBy: window.google.maps.places.RankBy.RATING
                };

                const searchNearbyPlaces = () => {
                    return new Promise((resolve, reject) => {
                        service.nearbySearch(request, (results, status) => {
                            if (status === window.google.maps.places.PlacesServiceStatus.OK) {
                                resolve(results);
                            } else {
                                reject(new Error(`Places API error: ${status}`));
                            }
                        });
                    });
                };

                const results = await searchNearbyPlaces();
                setRestaurants(results);
                setLoading(false);
                const newMarkers = [];


                results.forEach((restaurant) => {
                    if (restaurant.geometry?.location) {
                        const marker = new window.google.maps.marker.AdvancedMarkerElement({
                            position: restaurant.geometry.location,
                            map: mapInstance,
                            title: restaurant.name,
                        });

                        const infowindow = new window.google.maps.InfoWindow({
                            content: `<div>
                                            <h3>${restaurant.name}</h3>
                                            <p>${restaurant.vicinity}</p>
                                            <p>${restaurant.rating ? `${restaurant.rating} ⭐` : "No rating"}</p>
                                          </div>`,
                        });

                        marker.addListener("click", () => infowindow.open(mapInstance, marker));
                    newMarkers.push(marker);
                    }

                });
                setMarkers(markers);
            } catch (err) {
                console.error("Error in loadMapAndSearchRestaurants:", err);
                setError("An unexpected error occurred while loading the map.");
            }
        };

        checkAndLoadMap();

    }, [searchLocation, navigate, markers]);

    return (
        <div className="results-page">
            <div className="results-header">
                <button onClick={() => navigate("/")} className="back-button">
                    <i className="fas fa-arrow-left"></i> Back to Search
                </button>
                <h1>Restaurants near {searchLocation?.address || "the selected location"}</h1>
            </div>

            <div className="results-container">
                <div id="map" className="map-container"></div>

                <div className="restaurants-list">
                    {loading && <div className="loading">Searching for restaurants...</div>}
                    {error && <div className="error-message">{error}</div>}

                    {!loading &&
                        !error &&
                        restaurants.map((restaurant) => (
                            <div key={restaurant.place_id} className="restaurant-card">
                                {restaurant.photos?.[0] && (
                                    <img
                                        src={restaurant.photos[0].getUrl()}
                                        alt={restaurant.name}
                                        className="restaurant-image"
                                    />
                                )}
                                <div className="restaurant-info">
                                    <h3>{restaurant.name}</h3>
                                    <p>{restaurant.vicinity}</p>
                                    <div className="restaurant-details">
                                        <span className="rating">
                                            {restaurant.rating
                                                ? `${restaurant.rating} ⭐`
                                                : "No rating"}
                                        </span>
                                        {restaurant.price_level && (
                                            <span className="price-level">
                                                {"$".repeat(restaurant.price_level)}
                                            </span>
                                        )}
                                    </div>
                                    {restaurant.opening_hours && (
                                        <p className={`status ${restaurant.opening_hours.isOpen
                                            ? restaurant.opening_hours.isOpen()
                                                ? "open"
                                                : "closed"
                                            : "unknown"
                                            }`}>
                                            {restaurant.opening_hours.isOpen
                                                ? restaurant.opening_hours.isOpen()
                                                    ? "Open Now"
                                                    : "Closed"
                                                : "No Opening Information"}
                                        </p>
                                    )}
                                </div>
                            </div>
                        ))}
                </div>
            </div>
        </div>
    );
};

export default RestaurantResults;
